import GoogleBooks from './assets/images/book-search.png';
import ZooKeepr from './assets/images/zoo-keepr.png';
import WeatherDashboard from './assets/images/weather-dashboard.png';

export default [
    
    {
        "id": 7,
        "name": "Taskinator",
